import React from 'react'

import Cardsone from "./Cardsone";
import Cardtwo from "./Cardtwo";
import Cardsthree from "./Cardsthree";
import Cardsfour from "./Cardsfour";
import Cardsfive from "./Cardsfive";
import Cardsix from "./Cardsix";
import Cardsev from "./Cardsev";
import Cardsei from "./Cardsei";
import Cardsni from "./Cardsni";
import Cardsten from "./Cardsten";
import Cardsel from "./Cardsel";
import Cardstw from "./Cardstw";
import Cardslight from "./Cardslight";

function Cardmain() {
  return (
    <div>
    
<Cardsone />
<Cardtwo />
<Cardsthree />
<Cardsfour />
<Cardsfive />
<Cardsix />
<Cardsev />
<Cardsei />
<Cardsni />
<Cardsten />
<Cardsel />
<Cardstw />
<Cardslight />
    </div>
  )
}

export default Cardmain
